import React, { useEffect, useState } from 'react';
import axios from 'axios';

function BoardList() {
    const [list, setList] = useState([]);
    useEffect(()=> {
        axios.get('/api/board/list').then((res)=>{
            setList(res.data)
        })
    },[])
    return(
    <div>
        {
            list.map(function(a, i) {
                return (
                    <div>
                        글쓴이<div>{list[i].id}</div>
                        제목<div>{list[i].title}</div>
                        사용 기술<div>{list[i].skill_stack}</div>
                        분야<div>{list[i].work_field}</div>
                        정원<div>{list[i].max_people}</div>
                        마감일<div>{list[i].end_date}</div>
                    </div>
                )
            })
        }
    </div>
    );
}
export default BoardList;
